var timepickerFormId=0;$.editable.addInputType("timepicker",{submit:function(settings,original){var value=$("#h_").val()+":"+$("#m_").val()+$("#p_").val();$("input",this).val(value)},plugin:function(settings,original){$("input",this).filter(":hidden").attr("id","jquery_timepicker_"+ ++timepickerFormId).filter(":hidden").timepicker()}});